import React, { Fragment } from 'react';
import Footer from './components/Footer';
import Body from './components/Body';
import Header from './components/Header';

function App() {
  return (
    <Fragment>
      <Header/>
      <Body/>
      <Footer/>
      <Switch>
        <Route exact path="/home" component={Home}/>
      </Switch>
    </Fragment>
  );
}

export default App;
